import { StyledContainer } from "@components";
import { ComponentSocialMedia } from "./SocialMedia";
import { StyledSignUp } from "./Styles/SignUp";

interface IProps {
    socials: JSX.Element[];
}

export const ComponentSignUpEmail = (props: IProps) => {
    const { socials } = props;
    return (
        <StyledSignUp>
            <StyledContainer></StyledContainer>
            <ComponentSocialMedia socials={socials} />
        </StyledSignUp>
    );
};
